  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Roanoke
  River National Wildlife Refuge summarizes Refuge activities during the 2003 calendar
  year.  The report begins with an introduction to the Refuge and a summary of the
  yearu2019s highlights and climatic conditions.  Information about monitoring and
  studies- including surveys and censuses- is provided next.  Habitat restoration
  and management projects are also covered; activities include wetland restoration,
  water level management, and forest cutting.  Fish and wildlife management is discussed
  next with emphasis on bird banding.  Coordination activities, such as interagency
  coordination, private lands activities (easements), and cooperative/friends organizations,
  are outlined.  The resource protection section provides information about law enforcement,
  permits, contaminant investigation, and land acquisition.  Information about public
  education and recreation is given including insert public education topics.  Finally,
  Refuge planning and administration are discussed; topics include the Comprehensive
  Conservation Plan (CCP) and general administration.\",\n\t\"license_title\": \"License
